import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import Board from './components/Board';
import Division from './components/Division';

const BoardPage = () => {
    return (
        <>
        <Header />
        <br></br>
        <br></br>
        <table>
      <thead>
        <tr>
          <th>Lorem</th>
          <th>Ipsum</th>
          <th>Dolor</th>
        </tr>
      </thead>
      </table>
        <br></br>
        <Board />
        <br></br>
        <br></br>
        <Footer />
        </>
    );
};

export default BoardPage;
